  `id` bigint NOT NULL COMMENT '主键',
  `user_id` bigint NOT NULL COMMENT '用户主键',
  `posts_id` bigint NOT NULL COMMENT '帖子主键',
  `posts_user_id` bigint NOT NULL COMMENT '帖子所属用户主键',
